sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gcp_cf_spoke.fetch_location', {
        "project_id": inputs.projectid,
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var locations = [];
    obj.forEach(function(locationObj) {
        locations.push({
            "name": locationObj.name,
            "label": locationObj.name
        });
    })
    outputs.locations = {
        "data": locations
    }
})(inputs, outputs);

